$('#jstree-tree')
  .on('changed.jstree', function (e, data) {
    var objNode = data.instance.get_node(data.selected);
    $('#jstree-result').html('Selected: <br/><strong>' + objNode.id+'-'+objNode.text+'</strong>');
  })
  .jstree({
      plugins:['search'],
  core: {
    data: jsonData
  },
  search:
      {
          show_only_matches : true,
          show_only_matches_children:true,
          // search_leaves_only : true
      }
});

let interval;
let n = new Date()


$('#input-box').on("keyup change onload", function () {
    interval = new Date();
    interval = interval - n
    if(document.getElementById('input-box').value.length >= 4 && interval >= 600 ) {

        $('#jstree-tree').jstree(true).search($(this).val())
    }
    else if(document.getElementById('input-box').value.length === 0){
            $('#jstree-tree').jstree(true).search('');
            document.getElementById('input-box').value = null;
            document.getElementById('input-box').textContent = null;
    }
    n= new Date()
});
$('#clear').click(function () {
  $('#input-box').val('').change().focus();
    $('#jstree-tree').jstree(true).search('');
    document.getElementById('input-box').value = null;
    document.getElementById('input-box').textContent = null;
})

